import React, { Component } from 'react';

class PersonDetailAlbum extends Component {

    render () {
        return (
            <div>
                {
                    this.props.photos.map(pic => {
                        return (
                            <div className="detailSingleProfilePicContainer" key={pic.cover}></div>
                        )
                    })
                }
            </div>
        );
    }
}

export default PersonDetailAlbum
